import React from "react";
import Slider from "react-slick";
import { Card, CardContent, Typography } from "@mui/material";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./Programs.css";

const cardsData = [
  { id: 1, title: "Program 1", desc: "Description 1" },
  { id: 2, title: "Program 2", desc: "Description 2" },
  { id: 3, title: "Program 3", desc: "Description 3" },
  { id: 4, title: "Program 4", desc: "Description 4" },
  { id: 5, title: "Program 5", desc: "Description 5" },
  { id: 6, title: "Program 6", desc: "Description 6" },
];

const Programs = () => {
  const settings = {
    infinite: true,
    speed: 500,
    slidesToShow: 4, // desktop default
    slidesToScroll: 1,
    centerMode: true,
    centerPadding: "0px",
    autoplay: true,
    autoplaySpeed: 2000,
    responsive: [
      {
        breakpoint: 1024, // tablet
        settings: {
          slidesToShow: 2,
          centerMode: true,
        },
      },
      {
        breakpoint: 768, // mobile
        settings: {
          slidesToShow: 1,
          centerMode: true,
        },
      },
    ],
  };

  return (
    <div className="programs-container">
      <Slider {...settings}>
        {cardsData.map((card) => (
          <div key={card.id} className="program-card-wrapper">
            <Card className="program-card" elevation={3}>
              <CardContent>
                <Typography variant="h6">{card.title}</Typography>
                <Typography variant="body2">{card.desc}</Typography>
              </CardContent>
            </Card>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Programs;
